$(document).ready(function() {

	$(window).scroll(function() {
		/* Act on the event */
		if( $(this).scrollTop() > 40 ){
			$("#scroll-to-top").fadeIn();
		} else {
			$("#scroll-to-top").fadeOut();
		}
	});


	$("#scroll-to-top").click(function() {
		/* Act on the event */
		$('html, body').animate({scrollTop : 0}, 'smooth');
	});

	// Booking check
	$('main #booking-form .form-right form').on('click','.check', function() {
	    var vnf_regex = /((09|03|07|08|05)+([0-9]{8})\b)/g;
	    var mobile = $('main #booking-form .form-right form input:nth-child(2)').val();
	    if(mobile !==''){
	        if (vnf_regex.test(mobile) == false) 
	        {
	            alert('Your phone number is not in a right form. Please check again!!');
	            event.preventDefault();
	        }
	        else {
	        	alert("Thanks for your booking! Please wait the response from admins or owner.");
	        	return true;
	        }
	    }
    });

    // Contact check
    $('main #contact-content form').on('click','.check', function() {
	    var vnf_regex = /((09|03|07|08|05)+([0-9]{8})\b)/g;
	    var phone = $('main #contact-content form .contact-item-4 input').val();
	    if(phone !==''){
	        if (vnf_regex.test(phone) == false) 
	        {
	            alert('It is not a valid phone number. Please check again!!');
	            event.preventDefault();
	        }
	        else {
	        	alert("Thanks for your contact!");
	        	return true;
	        }
	    }
    });

    // Register check
    $('main #register-form form').on('click','.check', function() {
	    var email_regex = /^\w+([\.-]?\w+)*@\w+([\.-]?\w+)*(\.\w{2,3})+$/;
	    var email = $('main #register-form form #register-email').val();
	    var password = $('main #register-form form #register-password').val();
	   
	    if(email !== '' || password !== ''){
	        if (email_regex.test(email) == false || password.length < 8) 
	        {
	        	$('main #register-form form h5').css('color', 'red');
	            alert("You have entered an invalid input");
	            event.preventDefault();
	        }
	        else {
	        	return true;
	        }
	    }
    });

    // booking_form: ChangeEvent()
    var original = $('#booking-price').val();
	var priceNumber = Number(original);

	$("#booking-start").change(function (e) {
		$("#booking-start option:first-child").attr('disabled', 'disabled');
		$("#booking-end option:first-child").attr('disabled', 'disabled');

		var start = $('#booking-start').val();
		var totalPrice = 0;

		if (start == "6:00") {
			$('#booking-end').val("16:00");
			totalPrice = priceNumber;
		}
		if (start == "16:00") {
			$('#booking-end').val("17:30");
			totalPrice = priceNumber + 50000;
		}
		if (start == "17:30") {
			$('#booking-end').val("20:30");
			totalPrice = priceNumber + 100000;
		}
		if (start == "20:30") {
			$('#booking-end').val("22:00");
			totalPrice = priceNumber + 200000;
		}
		
		$('#booking-price').val(totalPrice);
	});

	$("#booking-end").change(function (e) {
		$("#booking-start option:first-child").attr('disabled', 'disabled');
		$("#booking-end option:first-child").attr('disabled', 'disabled');

		var end = $('#booking-end').val();
		var totalPrice = 0;

		if (end == "16:00") {
			$('#booking-start').val("6:00");
			totalPrice = priceNumber;
		}
		if (end == "17:30") {
			$('#booking-start').val("16:00");
			totalPrice = priceNumber + 50000;
		}
		if (end == "20:30") {
			$('#booking-start').val("17:30");
			totalPrice = priceNumber + 100000;
		}
		if (end == "22:00") {
			$('#booking-start').val("20:30");
			totalPrice = priceNumber + 200000;
		}

		$('#booking-price').val(totalPrice);
	});

});

$(function(){
	$passHide = 1; // pass is hidden for users

	$('.PassShow').click(function (e) {
		if ($passHide == 1) {
			$('#eye-toggle > input').attr('type', 'text');
			$passHide = 0; // pass is revealed to users
		} else {
			$('#eye-toggle > input').attr('type', 'password');
			$passHide = 1;
		}
		
		e.preventDefault();
	});
});

