let perPage = 9;
let currentPage = 1;
let start = 0;
let end = perPage;

const totalPages = Math.ceil(product.length / perPage);

const btnNext = document.querySelector('.btn-next');
const btnPrev = document.querySelector('.btn-prev');

function getCurrentPage(currentPage) {
	start = (currentPage - 1) * perPage;
	end = currentPage * perPage;
}

function renderProduct() {
	html = '';
	const content = product.map((item, index) => {
		if (index >= start && index < end) {
			html += '<div class="content-product-item">';
	        html += '<a href="index.php?c=booking&a=info&id=' + item.id + '">';
	        html += '<img src="' + item.image + '" alt="">';
	        html += '</a>';
	        html += '<h3>' + item.title + '</h3>';
	        html += '</div>';
	        return html;
		}
	})
	document.getElementById('product').innerHTML = html;
}
renderProduct();

function renderListPage() {
	let html = '';
	html += `<li class="btn-warning"><a>1</a></li>`;

	for(let i = 2; i <= totalPages; i++){
		html += `<li><a>${i}</a></li>`;
	}
	document.getElementById('number-page').innerHTML = html;
}
renderListPage();

function changPage() {
	const currentPages = document.querySelectorAll('.number-page li');

	for (let i = 0; i < currentPages.length; i++) {
		currentPages[i].addEventListener('click', () => {
			let value = i + 1;
			currentPage = value;
			$('.number-page li').removeClass('btn-warning');
			currentPages[i].classList.add('btn-warning');
			if (currentPage === 1) {
				$('.btn-prev').css('visibility', 'hidden');
				$('.btn-next').css('visibility', 'visible');
			}
			else if (currentPage === totalPages) {
				$('.btn-next').css('visibility', 'hidden');
				$('.btn-prev').css('visibility', 'visible');
			}
			else {
				$('.btn-next').css('visibility', 'visible');
				$('.btn-prev').css('visibility', 'visible');
			}
			getCurrentPage(currentPage);
			renderProduct();
		})
	}
}
changPage();

btnNext.addEventListener('click', () => {
	currentPage++;
	if (currentPage > totalPages){
		currentPage = totalPages;
	}
	if (currentPage === totalPages) {
		$('.btn-next').css('visibility', 'hidden');
	}
	$('.btn-prev').css('visibility', 'visible');
	$('.number-page li').removeClass('btn-warning');
	$(`.number-page li:eq(${currentPage-1})`).addClass('btn-warning');
	getCurrentPage(currentPage);
	renderProduct();
})

btnPrev.addEventListener('click', () => {
	currentPage--;
	if (currentPage < 1){
		currentPage = 1;
	}
	if (currentPage === 1) {
		$('.btn-prev').css('visibility', 'hidden');
	}
	$('.btn-next').css('visibility', 'visible');
	$('.number-page li').removeClass('btn-warning');
	$(`.number-page li:eq(${currentPage-1})`).addClass('btn-warning');
	getCurrentPage(currentPage);
	renderProduct();
})

// Search pitch list
// Getting elements
const pitches = product.map((item, index) => {
	return item.title;
});
const searchWrapper = document.querySelector(".search-input");
const inputBox = document.querySelector("main #booking-heading input");
const suggBox = document.querySelector(".autocom-box");


// if users press any key and release
inputBox.onkeyup = (e)=>{
	let userData = e.target.value; // user enter data
	let emptyArray = [];
	if(userData) {
		emptyArray = pitches.filter((data)=>{
			// filtering array value and user char to lowercase and 
			// return only those words which start with user entered word
			return data.toLocaleLowerCase().startsWith(userData.toLocaleLowerCase());
		});
		emptyArray = emptyArray.map((data)=>{
			return data = '<li>'+ data +'</li>';
		});
		suggBox.classList.add("active");
		showSuggestions(emptyArray);

		let allList = suggBox.querySelectorAll("li");
		for (let i = 0; i < allList.length; i++) {
			allList[i].setAttribute("onclick", "select(this)");
		}
	}else{
		suggBox.classList.remove("active");
	}
}

function select(element) {
	let selectUserData = element.textContent;
	inputBox.value = selectUserData;
	suggBox.classList.remove("active");
	for (let i = 0; i < pitches.length ; i++) {
		if (inputBox.value == pitches[i]) {
			let id = i+1;
			$("main #booking-heading .search-input #search-button").attr('href', 'index.php?c=booking&a=info&id='+id);
		}
	}
}

function showSuggestions(list) {
	let listData;
	if(!list.length){
		userValue = inputBox.value;
		listData = '<li>'+ userValue +'</li>'
	}else{
		listData = list.join('');
	}
	suggBox.innerHTML = listData;
}

function number_format(number, decimals, dec_point, thousands_point) {

    if (number == null || !isFinite(number)) {
        throw new TypeError("number is not valid");
    }

    if (!decimals) {
        var len = number.toString().split('.').length;
        decimals = len > 1 ? len : 0;
    }

    if (!dec_point) {
        dec_point = '.';
    }

    if (!thousands_point) {
        thousands_point = ',';
    }

    number = parseFloat(number).toFixed(decimals);

    number = number.replace(".", dec_point);

    var splitNum = number.split(dec_point);
    splitNum[0] = splitNum[0].replace(/\B(?=(\d{3})+(?!\d))/g, thousands_point);
    number = splitNum.join(dec_point);

    return number;
}

